# Optick Frame Stack Builder
# 将一帧的事件列表转换成一帧的事件堆栈
# 构建依据是事件的时间戳

import math
import json
from util import *


class FrameEvent(object):

    def __init__(self, func_event):
        # func_event = [time_start, time_end, time_total, name]
        self.time_start = func_event[0]     # 此函数事件(及其子事件)的时间片开始
        self.time_end = func_event[1]       # 此函数事件(及其子事件)的时间片结束
        self.time_total = func_event[2]     # 此函数事件(及其子事件)的所用时间
        self.time_self = func_event[2]      # 此函数事件自身的所用时间
        self.name = func_event[3]           # 此函数事件的描述（func, file, line）
        self.children = []                  # 此函数事件的子事件集合

    def append_child(self, child):
        self.children.append(child)
        self.time_self -= child.time_total


def contain_event(event_tree, event):
    """ 根据时间戳的范围判断某个事件是不是在事件树里 """
    if event_tree.time_start <= event.time_start and event.time_end <= event_tree.time_end:
        return True
    return False


def insert_event(event_tree, event):
    """ 将事件插入到事件树里（插入前确保事件的时间戳在事件树范围内） """
    for sub_tree in event_tree.children:
        if contain_event(sub_tree, event):
            return insert_event(sub_tree, event)
    event_tree.append_child(event)
    return None


def sort_event_tree(event_tree):
    """ 将事件树中的事件按照时间先后排序 """
    event_tree.time_total = get_round_time(event_tree.time_total)
    event_tree.time_self = get_round_time(event_tree.time_self)
    if not event_tree.children:
        return
    # sorted(event_tree.children, key=lambda e: e.time_start)
    for child in event_tree.children:
        sort_event_tree(child)


def event_tree_to_json(event_json, event_tree):
    """ 将事件树转换成Json格式 """
    temp = {
        "time_total": event_tree.time_total,
        "time_self": event_tree.time_self,
        "name": event_tree.name,
        "child": []
    }
    for child in event_tree.children:
        event_tree_to_json(temp, child)
    event_json["child"].append(temp)
    return None


class OptickFrameBuilder(object):

    def __init__(self, data):
        # data 是一个列表，内含n个(time_begin, time_end, desc_index)格式的数据
        self.data = data
        self.events = []
        self.root = FrameEvent((0, math.inf, math.inf, "Root"))  # 事件树
        self.min_time_limit = 0.001   # 耗时小于此值的事件将被过滤，不参与构建

    def read_data(self):
        """ 读取数据并进行初步处理 """
        for line in self.data:
            # format : (time_begin, time_end, desc_index)
            # example : (5278985031655, 5278985321800, 61)
            time_start = line[0]
            time_end = line[1]
            time_total = time_end - time_start
            name = line[2]
            self.events.append(FrameEvent((time_start, time_end, time_total, name)))

    def build_event_tree(self):
        """ 构建事件树 """
        for event in self.events:
            # 耗时小于限制的函数将被过滤
            if get_round_time(event.time_total) < self.min_time_limit:
                continue
            insert_event(self.root, event)
        sort_event_tree(self.root)

    def build_event_json(self):
        """ 构建事件树的Json格式 """
        json_data = {
            "child": [],
        }
        event_tree_to_json(json_data, self.root)
        return json_data["child"][0]

    def run(self):
        self.read_data()
        self.build_event_tree()
        return self.build_event_json()


